import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { createTodo, getTodos } from "../apis";
import useTodo from "../hooks/useTodo";

export default function Todo() {
    const navigate = useNavigate()
    const token = localStorage.getItem("access_token")
    const [todo, setTodo] = useState("")
    const [todos, setTodos] = useState([])
    const { handleSumbit } = useTodo()

    // 페이지 시작시
    useEffect(() => {
        // 토큰이 없다면 로그인 페이지로 이동
        if (!token) navigate("/signin")

        // Todo 리스트 받아오기

        console.log(getTodos())
    }, [])

    return (
        <>
            <button onClick={() => navigate("/")}>메인 이동</button>
            <div>TodoList</div>
            <div>TodoMaker
                <input data-testid="new-todo-input" onChange={(e) => setTodo(e.target.value)} />
                <button data-testid="new-todo-add-button" onClick={() => createTodo(todo)}>추가</button>
            </div>
        </>
    )
}
